	@Inject
	public RDSLGrammarAccess(GrammarProvider grammarProvider,
			TerminalsGrammarAccess gaTerminals) {
		this.grammar = internalFindGrammar(grammarProvider);
		this.gaTerminals = gaTerminals;
		this.pModel = new ModelElements();
		this.pRequirementGroup = new RequirementGroupElements();
		this.pEString = new EStringElements();
		this.pRequirement = new RequirementElements();
		this.pVersion = new VersionElements();
		this.pComment = new CommentElements();
		this.eType = new TypeElements();
		this.ePriority = new PriorityElements();
		this.pEDate = new EDateElements();
		this.eState = new StateElements();
		this.eResolution = new ResolutionElements();
		this.pEInt = new EIntElements();
	}
	
	protected Grammar internalFindGrammar(GrammarProvider grammarProvider) {
		Grammar grammar = grammarProvider.getGrammar(this);
		while (grammar != null) {
			if ("requirements.dsl.RDSL".equals(grammar.getName())) {
				return grammar;
			}
			List<Grammar> grammars = grammar.getUsedGrammars();
			if (!grammars.isEmpty()) {
				grammar = grammars.iterator().next();
			} else {
				return null;
			}
		}
		return grammar;
	}
	
	@Override
	public Grammar getGrammar() {
		return grammar;
	}
	
	
	public TerminalsGrammarAccess getTerminalsGrammarAccess() {
		return gaTerminals;
	}

	
